import React, {Component} from 'react';

class Footer extends Component{
  render(){
    return(
      <div id="footer" className="col-md-12 navbar navbar-expand-sm" style={{bottom:'0',position:'absolute'}}>
        <span className="w-100 collapse-navbar ">
          <ul className="w-100 navbar-nav justify-content-center">
            <li className="navbar-item px-1 "><a className="navbar-link" href="#home">Home</a></li>
            <li className="navbar-item px-1 "><a className="navbar-link" href="#about">About Us</a></li>
            <li className="navbar-item px-1 "><a className="navbar-link" href="form">Forms</a></li>
            <li className="navbar-item px-1 "><a className="navbar-link" href="#contact">Contact Us</a></li>
          </ul>
        </span>
          <span className="text-right"><p className="m-0">Created By Gerard Cancino</p></span>
      </div>
    );
  }
}

export default Footer;
